// src/components/Skills.js
import React from 'react';
import '../Skills.css';

const skills = [
    'Amazon Web Services (AWS)', 'Analytics', 'Apache', 'Cascading Style Sheets (CSS)', 'cPanel',
    'CSS', 'Data Analytics', 'Data Science', 'E-commerce', 'Hosting & Web Design',
    'HTML', 'Linux', 'Linux System Administration', 'MySQL', 'Online Advertising',
    'Online Marketing', 'PHP', 'phpMyAdmin', 'Plesk', 'Search Engine Optimization (SEO)',
    'Social Media', 'Social Media Marketing', 'Social Networking', 'Web Analytics', 'WordPress'
];

const Skills = () => {
    return (
        <div className="skills">
            <h2>Skills</h2>
            <div className="skills-grid">
                {skills.map((skill, index) => (
                    <div key={index} className="skill-bubble">
                        {skill}
                    </div>
                ))}
            </div>
        </div>
    );
};

export default Skills;
